const Dashboard = React.lazy(() => import('./Screens/Dashboard/Dashboard'));
const CreateCardLayout = React.lazy(() => import('./Screens/CreateCardLayout/CreateCardLayout'));

const App = () => {


    return (
        <NoSSR>
            <BrowserRouter>

                <Route path="/" element={<Dashboard />} />
            </BrowserRouter>
        </NoSSR>

    );
}


export default App;
